import './aiService.scss';

const AiService = (): JSX.Element => {
    return (
        <div className="aiService">
            <div className="aiService__textWrapper">
                <h2>Fascinated about the Cloud?</h2>
                <span> We are fascinated about cloud and it's possibilities.</span> 
            </div>
        </div>
    );
}

export default AiService;
